CREATE TABLE `tab_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `order_time` datetime NOT NULL COMMENT '下单时间',
  `order_sum` double NOT NULL COMMENT '下单金额',
  `order_done` datetime DEFAULT NULL COMMENT '签收时间',
  `cust_id` int(11) NOT NULL COMMENT '顾客id',
  `sel_id` int(11) NOT NULL COMMENT '店铺id',
  `addr_id` int(11) NOT NULL COMMENT '地址id',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=926974786 DEFAULT CHARSET=utf8;

