/*Table structure for table `tab_seller` */

DROP TABLE IF EXISTS `tab_seller`;

CREATE TABLE `tab_seller` (
  `sel_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '店铺id',
  `sel_account` varchar(10) DEFAULT NULL COMMENT '卖家账号',
  `sel_pwd` varchar(10) DEFAULT NULL COMMENT '卖家密码',
  `sel_store` varchar(20) DEFAULT NULL COMMENT '店铺名字',
  `sel_info` varchar(250) NOT NULL COMMENT '店铺简历',
  `sel_img` varchar(250) NOT NULL COMMENT '店铺logo',
  `sel_local` varchar(50) DEFAULT NULL COMMENT '店铺详情',
  `sel_phone` varchar(11) DEFAULT NULL COMMENT '店铺号码',
  PRIMARY KEY (`sel_id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;

